<!DOCTYPE html>
<html>
<head>
<meta charset="utf-8"/>
<meta http-equiv="X-UA-Compatible" content="IE=edge"/>
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>RegisterPage</title>
<link rel="stylesheet" type="text/css" id="applicationStylesheet" href="RegisterPage.css"/>
<script id="applicationScript" type="text/javascript" src="RegisterPage.js"></script>
</head>
<body>
<div id="RegisterPage">
	<div id="Register_Background">
		<img id="register1" src="register1.png" srcset="register1.png 1x, register1@2x.png 2x">
			
		<img id="register" src="register.png" srcset="register.png 1x, register@2x.png 2x">
			
	</div>
	<div onclick="application.goToTargetView(event)" id="Home">
		<svg class="Rectangle_2">
			<rect id="Rectangle_2" rx="17" ry="17" x="0" y="0" width="109" height="42">
			</rect>
		</svg>
		<div id="Home_p">
			<span>Home</span>
		</div>
	</div>
	<div id="Privacy">
		<svg class="Rectangle_3">
			<rect id="Rectangle_3" rx="17" ry="17" x="0" y="0" width="109" height="42">
			</rect>
		</svg>
		<div id="Privacy_s">
			<span>Privacy</span>
		</div>
	</div>
	<div onclick="application.goToTargetView(event)" id="Login">
		<svg class="Rectangle_6">
			<rect id="Rectangle_6" rx="17" ry="17" x="0" y="0" width="109" height="42">
			</rect>
		</svg>
		<div id="Login_v">
			<span>Login</span>
		</div>
	</div>
	<div id="Register_w">
		<svg class="Rectangle_5">
			<rect id="Rectangle_5" rx="17" ry="17" x="0" y="0" width="109" height="42">
			</rect>
		</svg>
		<div id="Register_y">
			<span>Register</span>
		</div>
	</div>

			<rect id="Rectangle_7" rx="19" ry="19" x="0" y="0" width="109" height="158">
			</rect>
		</svg>
		<img id="film-roll" src="film-roll.png" srcset="film-roll.png 1x, film-roll@2x.png 2x">
			
		<div id="ID1_Film">
			<span>1 Film</span>
		</div>
	</div>
	<div id="ID1Song">
		<svg class="Rectangle_10">
			<rect id="Rectangle_10" rx="19" ry="19" x="0" y="0" width="109" height="158">
			</rect>
		</svg>
		<div id="ID1_Song">
			<span>1 Song</span>
		</div>
		<img id="vinyl" src="vinyl.png" srcset="vinyl.png 1x, vinyl@2x.png 2x">
			
	</div>
	<div id="ID1Bev">
		<svg class="Rectangle_11">
			<rect id="Rectangle_11" rx="19" ry="19" x="0" y="0" width="109" height="158">
			</rect>
		</svg>
		<div id="ID1_Bev">
			<span>1 Bev</span>
		</div>
		<img id="cocktail" src="cocktail.png" srcset="cocktail.png 1x, cocktail@2x.png 2x">
			
	</div>
	<div id="Logo">
		<svg class="Rectangle_12">
			<rect id="Rectangle_12" rx="0" ry="0" x="0" y="0" width="256" height="147">
			</rect>
		</svg>
		<img id="ID1film1son1bev" src="ID1film1son1bev.png" srcset="ID1film1son1bev.png 1x, ID1film1son1bev@2x.png 2x">
			
	</div>
	<div id="Text_Register_Page">
		<div id="Register_bf">
			<span>Register</span>
		</div>
		<div id="Create_new_account">
			<span>Create new account.</span>
		</div>
		<svg class="Line_1" viewBox="0 0 355 2">
			<path id="Line_1" d="M 0 0 L 355 0">
			</path>
		</svg>
	</div>
	<div id="Email">
		<svg class="Rectangle_13">
			<rect id="Rectangle_13" rx="9" ry="9" x="0" y="0" width="412" height="49">
			</rect>
		</svg>
		<div id="Email_bk">
			<span>Email</span>
		</div>
	</div>
	<div id="Password">
		<svg class="Rectangle_14">
			<rect id="Rectangle_14" rx="9" ry="9" x="0" y="0" width="412" height="49">
			</rect>
		</svg>
		<div id="Password_bn">
			<span>Password</span>
		</div>
	</div>
	<div id="ConfirmPassword">
		<svg class="Rectangle_15">
			<rect id="Rectangle_15" rx="9" ry="9" x="0" y="0" width="412" height="49">
			</rect>
		</svg>

			<span>Confirm Password</span>
		</div>
	</div>
	<div onclick="application.goToTargetView(event)" id="RegisterButton">
		<svg class="Rectangle_16_bt">
			<linearGradient id="Rectangle_16_bt" spreadMethod="pad" x1="0.976" x2="0.28" y1="0.071" y2="1">
				<stop offset="0" stop-color="#1c4c84" stop-opacity="1"></stop>
				<stop offset="1" stop-color="#0e2642" stop-opacity="1"></stop>
			</linearGradient>
			<rect id="Rectangle_16_bt" rx="5" ry="5" x="0" y="0" width="173" height="54">
			</rect>
		</svg>
		<div id="Register_bu">
			<span>Register</span>
		</div>
	</div>
</div>
</body>
</html>
